description:
There is no official release of this entire series on home video so if you like the series please continue seeding so that other fans can download as well. Check my other uploads for other cartoons that never got complete DVD releases.

&quot;Presley is the incarnation of the Pharaoh's son, Prince Rapses whose spirit lies inside him. The mummies are the protectors of the Prince. The mummies (Ja-Kal, Rath, Armon &amp; Nefer-Tina) have the ability to transform and get special powers. They use these powers to fight off the evil villains, mostly Scarab, who is after the spirit of Prince Rapses for immortality.&quot;

Copied from the original release:
&quot;Seven of the 42 episodes are DVDRips, the rest are encoded from episodes recorded on old VHS tapes.  I cleaned up the audio and video of the VHS tape rips as much as possible... but there has been some degradation (which is to be expected).  There are one or two episodes that are more distorted than the others; however, all of the episodes are watchable.&quot;
